import FbBuy from 'FbBuy';

const AskForDetailsComponent = () => {
    return FbBuy.createElement(
        'div',
        null,
        FbBuy.createElement(
            'button',
            null,
            'Ask For Details'
        ),
        FbBuy.createElement(
            'p',
            null,
            'This automaically sends a message to the seller.'
        ),
        FbBuy.createElement('div', null),
        FbBuy.createElement('img', { src: require('../assets/ic_messenger.png') }),
        FbBuy.createElement(
            'p',
            null,
            'Message'
        ),
        FbBuy.createElement('img', { src: require('../assets/ic_messenger.png') }),
        FbBuy.createElement(
            'p',
            null,
            'Save '
        ),
        FbBuy.createElement('img', { src: require('../assets/ic_messenger.png') }),
        FbBuy.createElement(
            'p',
            null,
            'Share'
        )
    );
}

export default AskForDetailsComponent;
